  input: TEXT,F3XA,,"The purpose of this memo is to notate that the 'Stone's Phones,
    Inc.' independent expenditure that was revised on 10/04/06 has been reversed in
    Line 24 due to the fact the payment was voided in 10/04/06.  This independent
    expenditure relates to the revised amount that was made on the amendment for the
    September 20th monthly which was submitted on 10/05/06 as a debt and obligation
    Line 10.  In addition, the revised debt amount has been exstinguished and reported
    in Line 24.  Please read October 20th monthly's memo for more details.  Also another
    amendment was made to reflect retro deletions of several contributions from previous
    months that were not intended for the Sierra Club Political Committee.  Lastly,
    a second amendment was made to reflect a contribution in line 11(a) from 'Sara
    Rappaport' that was made on 10/18/06, and also to reflect a independant expenditure
    in line 24 made to 'GRS Consulting, LLC'. "
